import './Contact.css'
import {CURRENTLINE, GREEN, PINK, PURPLE} from "../../helpers/colors";

const Contact = () => {
    return (
        <>
            <div className="card">
                <img className="card-img" src="https://via.placeholder.com/200"/>
                <div className="card-body">
                    <ul className="list-group">
                        <li className="list-group-item list-group-item-dark">
                            Full Name: {" "}
                            <span> samira</span>
                        </li>
                    </ul>
                </div>
            </div>
        </>
    )
}
export default Contact;
